  false,\n\t\"url\": null,\n\t\"notes\": \"Initial survey instructions for the Spring
  Water Monitoring - Flow 1.02 survey at Fish Springs National Wildlife Refuge.  This
  coop baseline monitoring survey has been conducted each year since 1964.  It is
  conducted monthly in palustrine environments across multiple management units of
  the refuge.  This survey supports the following objectives from the Habitat Management
  Plan (HMP):  4.3A, Permanently Flooded Wetland and Open Water Objective; 4.3D, Saturated/Intermittently
  Flooded Wetland Objective; 4.3C, Seasonally-flooded Wetland and Open Water Objective;
  andn4.3B, Semi-permanently Flooded Marsh and Open Water Objective. As of March 2015,
  spring flow (CFS) is monitored at 8-flume locations on the refuge. Measurements
  are taken once a month; usually during the last week of the month. Water flow is
  measured using two methods: u2018Historical Flume Measureu2019 and u2018Flow Probe
  Meteru2019.  Instructions for how to take both measurements are provided.  CFS calculation
  table for Parshall flumes, datasheets and width calculations by flume size are included
  with this record.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
